import React from "react";
import ContactUs from "../ContactUs";

export default function TestResults(score) {
  const currentScore = score.scoreSix;

  function getLevelFromScore(currentScore) {
    if (currentScore <= 15) {
      console.log("A1");
      return "A1";
    } else if (currentScore >= 16 && currentScore <= 23) {
      console.log("A2");
      return "A2";
    } else if (currentScore >= 24 && currentScore <= 30) {
      console.log("B1");
      return "B1";
    } else if (currentScore >= 31 && currentScore <= 35) {
      console.log("B2");
      return "B2";
    }
  }

  return (
    <>
      <section className="test-results-container">
        <h2>
          Congratulations! You achieved level {getLevelFromScore(currentScore)}
        </h2>
        <ContactUs />
        <div className="link-wrapper">
          <a
            href={`https://www.carl-schurz-haus.de/nc/sprachkurse/erwachsene.html?kathaupt=1&katid=67&katvaterid=64&katname=${getLevelFromScore(
              currentScore
            )}`}
            target="_blank"
            rel="noreferrer"
            className="recommendations-link"
          >
            {getLevelFromScore(currentScore)} course recommendations
          </a>
        </div>
      </section>
    </>
  );
}
